import React from "react";
import "./Styles/Home.css";

function Home() {
    return (
        <div className="home">
            <div className="section">
                <h1>MojNP</h1>
                <p>Service made for citizens of Novi Pazar</p>
            </div>
        </div>
    );
}

export default Home;
